:root {
  --primary-text-color: #e5e5e5;
  --secondary-text-color: #b3b3b3;
  --primary-background-color: #141414;
  --secondary-background-color: #181818;
  --left-right-spacing: 60px;
}
@media (max-width: 1400px) {
  :root {
    --left-right-spacing: 4%;
  }
}

* {
  box-sizing: border-box;
}

html {
  overflow-y: scroll;
  -webkit-tap-highlight-color: transparent;
}

body {
  min-width: 280px;
  font-size: 16px;
  color: var(--primary-text-color);
  background: var(--primary-background-color);
  word-break: keep-all;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}

img {
  max-width: 100%;
  vertical-align: top;
  object-fit: cover;
}

a {
  color: var(--primary-text-color);
  text-decoration: none;
}

button {
  cursor: pointer;
  outline: none;
  border: 0;
  background: transparent;
  padding: 0;
}

svg {
  outline: none;
}

.sr-only {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  border: 0;
}

[data-src] {
  position: absolute;
  left: 0;
  top: 0;
  right: 0;
  bottom: 0;
  opacity: 0;
  transition: opacity 0.2s;
}

.loaded [data-src] {
  opacity: 1;
}

.nc-header {
  position: -webkit-sticky;
  position: sticky;
  display: flex;
  align-items: center;
  top: 0;
  z-index: 998;
  height: 68px;
  padding: 0 var(--left-right-spacing);
  background-color: var(--primary-background-color);
}
.nc-header .nc-branding {
  margin: 0;
}
.nc-header .nc-logo {
  display: block;
}
.nc-header .nc-nav {
  display: flex;
  margin: 0 24px;
}
.nc-header .nc-nav > a {
  display: block;
  padding: 10px;
  transition: color 0.2s;
}
.nc-header .nc-nav > a:hover {
  color: #b3b3b3;
}
.nc-header .nc-actions {
  display: flex;
  align-items: center;
  margin-left: auto;
}

.nc-inner {
  position: relative;
  padding: 0 var(--left-right-spacing);
}

@keyframes pulsateAnimation {
  from {
    background-color: #1a1a1a;
  }
  25% {
    background-color: #333;
  }
  50% {
    background-color: #1a1a1a;
  }
  to {
    background-color: #1a1a1a;
  }
}
.nc-tracks {
  width: 100%;
}

.nc-track {
  position: relative;
  margin: 48px 0;
  overflow: hidden;
}
.nc-track h2 {
  font-size: 36px;
  margin: 0 0 18px;
  padding: 0 var(--left-right-spacing);
}

.nc-swiper-wrapper {
  white-space: nowrap;
  font-size: 0;
}
.nc-swiper-wrapper .nc-swiper-slide {
  position: relative;
  display: inline-block;
  width: 16.66666667%;
  padding: 0 2px;
  font-size: 16px;
}
@media (max-width: 1400px) {
  .nc-swiper-wrapper .nc-swiper-slide {
    width: 20%;
  }
}
@media (max-width: 1024px) {
  .nc-swiper-wrapper .nc-swiper-slide {
    width: 25%;
  }
}
@media (max-width: 768px) {
  .nc-swiper-wrapper .nc-swiper-slide {
    width: 33.333333%;
  }
}
@media (max-width: 600px) {
  .nc-swiper-wrapper .nc-swiper-slide {
    width: 50%;
  }
}
.nc-swiper-wrapper .nc-swiper-slide > a {
  display: block;
}
.nc-swiper-wrapper .nc-swiper-slide .thumbnail {
  position: relative;
  border-radius: 4px;
  overflow: hidden;
}
.nc-swiper-wrapper .nc-swiper-slide .thumbnail::before {
  content: "";
  display: block;
  background-color: rgba(255, 255, 255, 0.1);
  padding-bottom: 56.25%;
}
.nc-swiper-wrapper .nc-swiper-slide .metadata {
  padding: 10px;
  text-overflow: ellipsis;
  overflow: hidden;
  white-space: nowrap;
  text-align: center;
}

.nc-swiper-prev,
.nc-swiper-next {
  position: absolute;
  z-index: 10;
  top: 0;
  bottom: 0;
  display: flex;
  text-align: center;
  justify-content: center;
  width: var(--left-right-spacing);
  color: #fff;
  background-color: rgba(20, 20, 20, 0.5);
  cursor: pointer;
  transition: background-color 0.24s;
}
.nc-swiper-prev:hover,
.nc-swiper-next:hover {
  background-color: rgba(20, 20, 20, 0.7);
}

.nc-swiper-prev {
  left: 0;
}

.nc-swiper-next {
  right: 0;
}

.nc-preview {
  position: absolute;
  z-index: 999;
  left: 0;
  top: 0;
  pointer-events: none;
}
.nc-preview.expanded {
  display: flex;
  justify-content: center;
  width: 100%;
  height: 100%;
  padding: 56px 0;
  pointer-events: auto;
}
.nc-preview.expanded .nc-preview-inner {
  opacity: 1;
}
.nc-preview.expanded .nc-preview-close {
  display: block;
}
.nc-preview.expanded .nc-preview-thumbnail::after {
  content: "";
  position: absolute;
  left: 0;
  top: 0;
  right: 0;
  bottom: 0;
  background: linear-gradient(to top, #2a2828, transparent 50%);
}
.nc-preview.mini-expanded {
  position: absolute;
  pointer-events: auto;
  cursor: pointer;
}
.nc-preview.mini-expanded .nc-preview-inner {
  opacity: 1;
}
.nc-preview.mini-expanded .nc-preview-thumbnail::after {
  background: none;
}
.nc-preview.mini-expanded .nc-preview-metadata {
  opacity: 1;
}
.nc-preview.mini-expanded .nc-preview-close {
  display: none;
}

.nc-preview-inner {
  width: 90%;
  overflow: hidden;
  max-width: 1024px;
  border-radius: 4px;
  transform-origin: center top;
  will-change: transform;
  opacity: 0;
  box-shadow: rgba(0, 0, 0, 0.75) 0px 3px 10px;
  background-color: var(--secondary-background-color);
}

.nc-preview-thumbnail {
  position: relative;
}
.nc-preview-thumbnail::before {
  content: "";
  display: block;
  padding-bottom: 56.25%;
}
.nc-preview-thumbnail img {
  position: absolute;
  left: 0;
  top: 0;
  right: 0;
  bottom: 0;
  width: 100%;
}

.nc-preview-metadata {
  opacity: 0;
  transition: 0.2s;
  padding: 20px 14px 16px;
  background-color: var(--secondary-background-color);
}

.nc-preview-buttons {
  display: flex;
  justify-content: space-between;
}
.nc-preview-buttons > div {
  display: flex;
  align-items: center;
  justify-content: center;
}
.nc-preview-buttons button {
  display: flex;
  align-items: center;
  justify-content: center;
  width: 38px;
  height: 38px;
  border-radius: 50%;
  border: 1px solid #fff;
  margin-right: 8px;
}
.nc-preview-buttons button.play {
  background-color: #fff;
}
.nc-preview-buttons button:last-child {
  margin-right: 0;
}

.nc-preview-info {
  margin: 14px 0 12px 0;
  color: #b3b3b3;
  font-weight: 700;
}
.nc-preview-info .average {
  color: #46d369;
}
.nc-preview-info > span {
  padding: 0 2px;
}

.nc-preview-genres {
  font-size: 14px;
  color: #e6e6e6;
}
.nc-preview-genres > span:not(:first-child)::before {
  content: "•";
  font-size: 16px;
  color: #646464;
  padding: 0 12px;
}

.nc-preview-close {
  display: none;
  position: absolute;
  top: 0;
  right: 0;
  margin: 16px;
}
.nc-preview-close > button {
  width: 36px;
  height: 36px;
  padding: 8px;
  border-radius: 50%;
  color: #fff;
  background-color: var(--secondary-background-color);
}

