sources.styles/base.scss:
* {
  box-sizing: border-box;
}

html {
  overflow-y: scroll;
  -webkit-tap-highlight-color: transparent;
}

body {
  min-width: 280px;
  font-size: 16px;
  color: var(--primary-text-color);
  background: var(--primary-background-color);
  word-break: keep-all;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}

img {
  max-width: 100%;
  vertical-align: top;
  object-fit: cover;
}

a {
  color: var(--primary-text-color);
  text-decoration: none;
}

button {
  cursor: pointer;
  outline: none;
  border: 0;
  background: transparent;
  padding: 0;
}

svg {
  outline: none;
}

sources.styles/util.scss:
.sr-only {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  border: 0;
}

[data-src] {
  position: absolute;
  left: 0;
  top: 0;
  right: 0;
  bottom: 0;
  opacity: 0;
  transition: opacity .2s;
}
.loaded {
  [data-src] {
    opacity: 1;
  }
}

sources.styles/layout.scss:
.nc-header {
  position: -webkit-sticky;
  position: sticky;
  display: flex;
  align-items: center;
  top: 0;
  z-index: 998;
  height: 68px;
  padding: 0 var(--left-right-spacing);
  background-color: var(--primary-background-color);

  .nc-branding {
    margin: 0;
  }

  .nc-logo {
    display: block;
  }

  .nc-nav {
    display: flex;
    margin: 0 24px;

    > a {
      display: block;
      padding: 10px;
      transition: color .2s;      
      &:hover {
        color: #b3b3b3;
      }
    }
  }

  .nc-actions {
    display: flex;
    align-items: center;
    margin-left: auto;
  }
}

.nc-inner {
  position: relative;
  padding: 0 var(--left-right-spacing);
}

sources.styles/home.scss:
@keyframes pulsateAnimation {
  from {
    background-color: #1a1a1a
  }

  25% {
    background-color: #333
  }

  50% {
    background-color: #1a1a1a
  }

  to {
    background-color: #1a1a1a
  }
}

.nc-tracks {
  width: 100%;
}

.nc-track {
  position: relative;
  margin: 48px 0;
  overflow: hidden;
  h2 {
    font-size: 36px;
    margin: 0 0 18px;
    padding: 0 var(--left-right-spacing);
  }
}

.nc-swiper-wrapper {
  white-space: nowrap;
  font-size: 0;
  .nc-swiper-slide {
    position: relative;
    display: inline-block;
    width: 16.66666667%;
    padding: 0 2px;
    font-size: 16px;
    @media (max-width: 1400px) {
      width: 20%;
    }
    @media (max-width: 1024px) {
      width: 25%;
    }
    @media (max-width: 768px) {
      width: 33.333333%;
    }
    @media (max-width: 600px) {
      width: 50%;
    }
    > a {
      display: block;
    }
    .thumbnail {
      position: relative;
      border-radius: 4px;
      overflow: hidden;
      &::before {
        content: "";
        display: block;
        background-color: rgba(255, 255, 255, .1);
        padding-bottom: 56.25%
      }
    }
    .metadata {
      padding: 10px;
      text-overflow: ellipsis;
      overflow: hidden;
      white-space:nowrap;
      text-align: center;
    }
  }
}

.nc-swiper-prev,
.nc-swiper-next {
  position: absolute;
  z-index: 10;
  top: 0;
  bottom: 0;
  display: flex;
  text-align: center;
  justify-content: center;
  width: var(--left-right-spacing);
  color: #fff;
  background-color: rgba(20, 20, 20, .5);
  cursor: pointer;
  transition: background-color .24s;
  &:hover {
    background-color: rgba(20, 20, 20, .7);
  }
}

.nc-swiper-prev {
  left: 0;
}

.nc-swiper-next {
  right: 0;
}

.nc-preview {
  position: absolute;
  z-index: 999;
  left: 0;
  top: 0;
  pointer-events: none;
  &.expanded {
    display: flex;
    justify-content: center;
    width: 100%;
    height: 100%;
    padding: 56px 0;
    pointer-events: auto;
    .nc-preview-inner {
      opacity: 1;
    }
    .nc-preview-close {
      display: block;
    }
    .nc-preview-thumbnail {
      &::after {
        content: "";
        position: absolute;
        left: 0;
        top: 0;
        right: 0;
        bottom: 0;
        background: linear-gradient(to top, #2a2828, transparent 50%);
      }
    }
  }

  &.mini-expanded {
    position: absolute;
    pointer-events: auto;
    cursor: pointer;
    .nc-preview-inner {
      opacity: 1;
    }
    .nc-preview-thumbnail {
      &::after {
        background: none;
      }
    }
    .nc-preview-metadata {
      opacity: 1;
    }
    .nc-preview-close {
      display: none;
    }    
  }  
}

.nc-preview-inner {
  width: 90%;
  overflow: hidden;
  max-width: 1024px;
  border-radius: 4px;
  transform-origin: center top;
  will-change: transform;
  opacity: 0;
  box-shadow: rgb(0 0 0 / 75%) 0px 3px 10px;
  background-color: var(--secondary-background-color);
}

.nc-preview-thumbnail {
  position: relative;

  &::before {
    content: "";
    display: block;
    padding-bottom: 56.25%
  }

  img {
    position: absolute;
    left: 0;
    top: 0;
    right: 0;
    bottom: 0;
    width: 100%;
  }
}

.nc-preview-metadata {
  opacity: 0;
  transition: .2s;
  padding: 20px 14px 16px;
  background-color: var(--secondary-background-color);
}

.nc-preview-buttons {
  display: flex;
  justify-content: space-between;
  > div {
    display: flex;
    align-items: center;
    justify-content: center;
  }
  button {
    display: flex;
    align-items: center;
    justify-content: center;
    width: 38px;
    height: 38px;
    border-radius: 50%;
    border: 1px solid #fff;
    margin-right: 8px;

    &.play {
      background-color: #fff;
    }

    &:last-child {
      margin-right: 0;
    }
  }
}

.nc-preview-info {
  margin: 14px 0 12px 0;
  color: #b3b3b3;
  font-weight: 700;
  .average {
    color: #46d369;
  }
  > span {
    padding: 0 2px;
  }
}

.nc-preview-genres {
  font-size: 14px;
  color: #e6e6e6;
  > span {
    &:not(:first-child)::before {
      content: "\2022";
      font-size: 16px;
      color: #646464;
      padding:0 12px;
    }
  }
}

.nc-preview-close {
  display: none;
  position: absolute;
  top: 0;
  right: 0;
  margin: 16px;
  > button {
    width: 36px;
    height: 36px;
    padding: 8px;
    border-radius: 50%;
    color: #fff;
    background-color: var(--secondary-background-color);
  }
}
